import { configureStore } from "@reduxjs/toolkit";
import uiReducer from "./ui-slice";
import cartReducer from "./cart-slice";

const store = configureStore({
  reducer: { ui: uiReducer },
});

export default import("@reduxjs/toolkit").Store;
